import React from "react";
import "./soundWave.style.css";
import soundWaves from "../photos/soundWave.eps";

const SoundWave = () => {
  return (
    <div class="sound">
      <img class="img" src={soundWaves} alt="" />
      <p>soundwave</p>
    </div>
  );
};

export default SoundWave;
